import React from 'react';

import classes from './Respaldo.module.css';

const Respaldo = () => {
    return ( 
        <div className={classes.Respaldo}>
            <h2>Pasos:</h2>
            <div>
            <span>Altura</span><span>1.60</span>
                <div className={classes.main}>
                
            </div>
            <span>Ancho</span><span>1.40</span>
            </div>
            
            
        </div>
     );
}
 
export default Respaldo;
